import React from 'react';
import {Navbar, Button} from 'react-bootstrap';
import './comp.css';


export function TopNavBar() {

    return (
        <div className="navbar fixed-top">
            <Navbar id="topnav">
                <Button variant="outline-primary" id="btnConnect">Connect</Button>
            </Navbar>
        </div>
    )
}
